  html,
  body {
    height: 100%;
    margin: 0;
    padding: 0;
  }

  /* hide close button on marker */
  .gm-style-iw+div {
    display: none;
  }

  /* center name on marker */
  div.gm-style-iw {
    left: 27px !important;
  }

  .main-bg {
    height: 100%;
    background-image: url('ec49a8a7170b18b4f1dd8d2877c8004e.jpg');
    background-repeat: no-repeat;
    background-size: 100% 100%;
  }

  form {
    background: white;
    border: 5px solid darkcyan;
    padding: 25px;
    width: 70%;
    margin: 0 auto;
    position: relative;
    top: 26%;
  }

  button {
    width: 50%;
  }

  .button {
    text-align: center;
  }

  @media only screen and (max-width: 700px) {
    form {
      width: 97%;
      padding-bottom: 100px;
      padding-top: 100px; 
    }
    .main-bg {
      text-align: center;
    }
}
